import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'
import Link from 'next/link'
import Date from '../components/date'
import utilStyles from '../styles/utils.module.css'
// import { getSortedPostsData } from '../lib/posts'

const NOTION_BLOG_ID = '3672c8010da9404aa143b20ed50ab348'

export const getAllPosts = async () => {
	return await fetch(
    `https://notion-api.splitbee.io/v1/table/${NOTION_BLOG_ID}`
  ).then((res) => res.json());
}

export async function getStaticProps() {
  const allPostsData = await getAllPosts()
  return {
    props: {
      allPostsData
    }
  }
}

export default function Home({ allPostsData }) {
  return (
    <Layout page='home'>
      <Head>
        <title>{siteTitle}</title>
      </Head>
      <section>
        <p><b className='font-medium'>currently a product data scientist at Music & Podcasts.</b> fellow at Gold House. previously at Bird and JMI Equity. retired D1 swimmer at Penn. lover of athletics, films, delightful products, and oatmeal.</p>
        <br></br>
        <p>
          <b className='font-medium'>i'm working on a breaking into data science analytics course.</b> sign up below to my email list to get updates and early access on all new content.
        </p>
        <script async data-uid="40f5e63790" src="https://deft-designer-1531.ck.page/40f5e63790/index.js"></script>
      </section>
    </Layout>
  )
}
